아래 코드 셀은 12개의 서로 다른 폴리곤 개체를 포함하는 GeoSeries two_mile_buffer를 만듭니다. 각 다각형은 서로 다른 대기 모니터링 스테이션 주변의 2마일(또는 2*5280피트)의 버퍼입니다.

